// ==UserScript==
// @name         Amazon Web Services Well-Architected Framework Review Helper - Layout Config
// @namespace    http://console.aws.amazon.com/wellarchitected/
// @version      0.0.1
// @description  Pop up a layout config 
// @author       bobyeh@amazon.com (github:juntinyeh)
// @match        https://*.console.aws.amazon.com/wellarchitected/*
// @grant        GM.xmlHttpRequest
// @run-at       document-end
// ==/UserScript==


/***************************************/
/*FOLLOW UP*/

var oh_layout_config = document.createElement('div'); //Div Container
    oh_layout_config.id = 'oh_layout_config';
    oh_layout_config.style.display = 'block';
    oh_layout_config.innerHTML = '';

    oh_layout_config.style = 'max-width: 500px; max-height: 800px; overflow-y: auto;';
    oh_layout_config.style.display = 'block';
    oh_layout_config.style.position = 'absolute';
    oh_layout_config.style.top = '100px';
    oh_layout_config.style.left = '750px';
    oh_layout_config.style.border = 'dashed';
    oh_layout_config.style.padding = '10px';
    oh_layout_config.style.witdh = '400px';
    oh_layout_config.style.background = '#FFFFBB';
    oh_layout_config.z_index = 20000;


var oh_layout_config_btn = document.createElement('button');
    oh_layout_config_btn.id = 'oh_list_button';
    oh_layout_config_btn.innerHTML = 'Set';
    oh_layout_config_btn.addEventListener("click", function() {
        OH_Layout_Config_Set("Click");
    });


var oh_layout_config_cancel = document.createElement('button');
    oh_layout_config_cancel.id = 'oh_layout_config_cancel';
    oh_layout_config_cancel.innerHTML = 'Cancel';
    //oh_add_button.style = 'cursor: pointer; border: 1px solid blue;';
    oh_layout_config_cancel.addEventListener("click", function() {
        OH_Layout_Config_Set("Cancel");
    });

var img = "data:image/jpeg;base64,";


var img_center = document.createElement('img');
    img_center.src = img;
    img_center.addEventListener("click", function() {
        OH_Layout_Config_Set("CENTER");
    });

var img_left = document.createElement('img');
    img_left.src = img;
    img_left.addEventListener("click", function() {
        OH_Layout_Config_Set("LEFT");
    });

var img_float = document.createElement('img');
    img_float.src = img;
    img_float.addEventListener("click", function() {
        OH_Layout_Config_Set("FLOAT");
    });

oh_layout_config.appendChild(img_center);
oh_layout_config.appendChild(img_left);
oh_layout_config.appendChild(img_float);
oh_layout_config.appendChild(oh_layout_config_btn);
oh_layout_config.appendChild(oh_layout_config_cancel);

function OH_Layout_Config(){

    var objs = document.getElementsByClassName("awsui-app-layout__content--scrollable");
    objs.appendChild(oh_layout_config);
}

function OH_Layout_Config_Set(argument) {
    // body...
    console.log(argument);
}

